	faker.Date.birthDate = function randomDate(minAge, maxAge) {
		var start 	= minAge*YEAR,
			end 	= maxAge*YEAR;

		start 	= new Date() - start;
		end 	= new Date() - end;

	    return new Date(start + Math.random() * (end - start));
	}

