    faker.Internet.password = function () {
		var length=12;
	    var sPassword = "";

	    var noPunction = true;
	    var randomLength = true;

	    if (randomLength) {
	        length = Math.random();

	        length = parseInt(length * 100);
	        length = (length % 7) + 6
	    }


	    for (i=0; i < length; i++) {

	        numI = getRandomNum();
	        if (noPunction) { while (checkPunc(numI)) { numI = getRandomNum(); } }

	        sPassword = sPassword + String.fromCharCode(numI);
	    }

	    return sPassword;
	}

